"use strict";(self.webpackChunkoira_prototype=self.webpackChunkoira_prototype||[]).push([[818],{50818:function(n){n.exports='\x3c!-- Root element of PhotoSwipe. Must have class pswp. --\x3e\n<div\n    id="photoswipe-template"\n    class="pswp"\n    tabindex="-1"\n    role="dialog"\n    aria-hidden="true"\n>\n    \x3c!-- Background of PhotoSwipe. \n         It\'s a separate element as animating opacity is faster than rgba(). --\x3e\n    <div class="pswp__bg"></div>\n\n    \x3c!-- Slides wrapper with overflow:hidden. --\x3e\n    <div class="pswp__scroll-wrap">\n        \x3c!-- Container that holds slides. \n            PhotoSwipe keeps only 3 of them in the DOM to save memory.\n            Don\'t modify these 3 pswp__item elements, data is added later on. --\x3e\n        <div class="pswp__container">\n            <div class="pswp__item"></div>\n            <div class="pswp__item"></div>\n            <div class="pswp__item"></div>\n        </div>\n\n        \x3c!-- Default (PhotoSwipeUI_Default) interface on top of sliding area. Can be changed. --\x3e\n        <div class="pswp__ui pswp__ui--hidden">\n            <div class="pswp__top-bar">\n                \x3c!--  Controls are self-explanatory. Order can be changed. --\x3e\n                <div class="pswp__counter"></div>\n\n                <button\n                    class="pswp__button pswp__button--close"\n                    title="Close (Esc)"\n                ></button>\n                <button\n                    class="pswp__button pswp__button--share"\n                    title="Share"\n                ></button>\n                <button\n                    class="pswp__button pswp__button--fs"\n                    title="Toggle fullscreen"\n                ></button>\n                <button\n                    class="pswp__button pswp__button--zoom"\n                    title="Zoom in/out"\n                ></button>\n\n                \x3c!-- Preloader demo http://codepen.io/dimsemenov/pen/yyBWoR --\x3e\n                \x3c!-- element will get class pswp__preloader__active when preloader is running --\x3e\n                <div class="pswp__preloader">\n                    <div class="pswp__preloader__icn">\n                        <div class="pswp__preloader__cut">\n                            <div class="pswp__preloader__donut"></div>\n                        </div>\n                    </div>\n                </div>\n            </div>\n\n            <div\n                class="pswp__share-modal pswp__share-modal--hidden pswp__single-tap"\n            >\n                <div class="pswp__share-tooltip"></div>\n            </div>\n\n            <button\n                class="pswp__button pswp__button--arrow--left"\n                title="Previous (arrow left)"\n            ></button>\n\n            <button\n                class="pswp__button pswp__button--arrow--right"\n                title="Next (arrow right)"\n            ></button>\n\n            <div class="pswp__caption">\n                <div class="pswp__caption__center"></div>\n            </div>\n        </div>\n    </div>\n</div>\n'}}]);